function stakeTokens(uint256 depositAmount, uint256 stakingId) public payable {
    require(bytes1(isStakingAvailable) == 0x01, "Staking is not available");
    require(depositAmount >= minimumDeposit, "Deposit amount is too low");

    uint256 stakingIdHash = stakingId;
    require(storageMapStaking[stakingIdHash], "Invalid staking ID");

    address sender = msg.sender;
    address contractAddress = address(this);

    require(address(Token).code.length > 0, "Token contract is invalid");

    (bool success, bytes memory returnData) = address(Token).call(
        abi.encodeWithSelector(0x23b872dd, sender, contractAddress, depositAmount)
    );
    require(success, "Token transfer failed");

    uint256 returnDataLength = returnData.length;
    require(returnDataLength >= 32, "Invalid return data length");

    storageMapStaking[sender] += 1;
    bytes32 senderHash = keccak256(abi.encodePacked(sender));
    storageMapDeposits[senderHash] = depositAmount;

    storageMapStaking[sender] += 1;
    storageMapTimestamps[senderHash] = uint40(block.timestamp);

    require(storageMapStaking[sender] <= type(uint256).max - depositAmount, "Overflow error");

    revert("Staking is paused!");
}

